        "loremIpsumIsSimplyDummyTextOfThePrintingAndTypesettingIndustry":
            MessageLookupByLibrary.simpleMessage(
                "لوريم إيبسوم هو نص تجريبي من صناعة الطباعة والتنضيد. لوريم إيبسوم هو النص التجريبي القياسي في الصناعة منذ القرن الخامس عشر، عندما أخذ طابع غير معروف مجموعة من الطباعة ومزجها لعمل كتاب عينة. لقد نجت ليس فقط خمسة قرون، ولكن أيضًا القفزة إلى الطباعة الإلكترونية، مع الحفاظ على حالتها الأساسية. تم ترويجها في الستينيات مع إصدار أوراق ليتراسيت التي تحتوي على مقاطع لوريم إيبسوم، ومؤخراً مع برامج النشر المكتبي مثل ألدو صفحة ميكر بما في ذلك إصدارات من لوريم إيبسوم."),
        "loremIpsumIsSimplyDummyTextOfThePrintingAndTypesettingIndustry2":
            MessageLookupByLibrary.simpleMessage(
                "لوريم إيبسوم هو ببساطة نص شكلي يستخدم في صناعة الطباعة والتنضيد. كان لوريم إيبسوم النص الشكلي القياسي في هذه الصناعة منذ القرن الخامس عشر، عندما أخذ طابع مجهول حروف الطباعة وخلطها لصنع كتاب نموذج للحروف. لقد نجا ليس فقط لخمسة قرون، ولكن أيضًا مع الانتقال إلى النشر الإلكتروني، حيث بقي بشكل أساسي دون تغيير. تم تعميمه في الستينيات من خلال إصدار أوراق Letraset التي تحتوي على مقتطفات من لوريم إيبسوم، ومؤخرًا مع برامج النشر المكتبي مثل Aldus PageMaker بما في ذلك إصدارات من لوريم إيبسوم.\\nعلى عكس الاعتقاد الشائع، لوريم إيبسوم ليس مجرد نص عشوائي. بل إنه مستمد من قطعة من الأدب اللاتيني الكلاسيكي من عام 45 قبل الميلاد، مما يجعله أكثر من 2000 عام. قام ريتشارد مككلينتوك، أستاذ اللغة اللاتينية في كلية هامبدن-سيدني في فيرجينيا، بالبحث عن إحدى الكلمات اللاتينية الأكثر غموضًا، وهي \"consectetur\"، من إحدى مقاطع لوريم إيبسوم، وقام بفحص الاقتباسات.\\nيتم إعادة إنتاج القطعة القياسية من لوريم إيبسوم المستخدمة منذ القرن الخامس عشر أدناه لأولئك المهتمين. كما يتم إعادة إنتاج الأقسام 1.10.32 و1.10.33 من كتاب \"حول حدود الخير والشر\" لشيشرون في شكلها الأصلي الدقيق، مرفقة بالإصدارات الإنجليزية من ترجمة عام 1914 بواسطة ه. راكهام."),
